import NewExpenceItem from "./components/Expences/NewExpenceItem";
import FormAddExpense from "./components/FormAddExpense/FormAddExpense";
function App() {
  const expenses = [
    {
      id: "e1",
      title: "Toilet Paper",
      amount: 94.12,
      date: new Date(2020, 7, 14),
    },
    { id: "e2", title: "New TV", amount: 799.49, date: new Date(2021, 2, 12) },
    {
      id: "e3",
      title: "Car Insurance",
      amount: 294.67,
      date: new Date(2021, 2, 28),
    },
    {
      id: "e4",
      title: "New Desk (Wooden)",
      amount: 450,
      date: new Date(2021, 5, 12),
    },
  ];
  return (
    <div>
      <p>{expenses[0].title}</p>
      <h2>Let's get started!</h2>

      <FormAddExpense />

      <div className="expenses">
        <NewExpenceItem item={expenses} />
      </div>
    </div>
  );
}

export default App;
